<script setup lang="ts">

import {gsap} from "gsap";
import {DrawSVGPlugin} from 'gsap/DrawSVGPlugin'
import {onMounted} from "#imports";


let active = ref(false)

gsap.registerPlugin(DrawSVGPlugin);
const TL = gsap.timeline()


const route = useRoute()



function end() {

    active.value = true

}


onMounted( async () => {



  if(route.fullPath === "/") {


    TL.set('body', {
        overflowY: 'hidden',

    })


        .fromTo("path.white", {
      drawSVG: "0%"}, {
      duration: 1,
      delay:1.5,
      drawSVG: "100%",
      ease: "expo.inOut"})
        .to("path.light-green", {
          duration: 1,
          fill: "#b5c37b"})
        .to("path.white", {
          duration: 1,
          fill: "white"})
        .to("path.title", {
          duration: 1,
          delay: 1,
          fill: "white"})
  TL.to(['#preloader', '.wilzen'], {
      opacity: 0,
      delay:1.5,
      transition: 'all',
    width: 0,
    height: 0,
    }).set('body', {
      overflowY: 'auto',
      overflowX: 'hidden'
  })

      setTimeout(end, 10000)

  } else {

    active.value = false


  }


});


</script>

